ActivitySummary.query:
q_acc = load "${App.Datasets.SFDC_EA_SP_Account.FullyQualifiedName}";
q_acc = group q_acc by ('Id');
q_act = load "${App.Datasets.SFDC_EA_SP_Activity.FullyQualifiedName}";
q_act = filter q_act by 'IsClosed' == "true";
q_act = group q_act by ('AccountId');
q_acc_act_opp = cogroup q_acc by 'Id' left, q_act  by 'AccountId';
q_acc_act_opp = foreach q_acc_act_opp generate 
case when coalesce(unique(q_act.'Id'), 0) == 0  then "6. =  0回"
     when coalesce(unique(q_act.'Id'), 0) >= 10 then "1. ≧ 10回"
     when coalesce(unique(q_act.'Id'), 0) >= 5  then "2. ≧  5回"
     when coalesce(unique(q_act.'Id'), 0) >= 3  then "3. ≧  3回"
     when coalesce(unique(q_act.'Id'), 0) >= 2  then "4. ≧  2回"
     when coalesce(unique(q_act.'Id'), 0) >= 1  then "5. ≧  1回"
     else null end as 'totalActivityCnt_Range', coalesce(unique(q_acc.'Id'), 0) as 'unique_Id', coalesce(unique(q_act.'Id'), 0) as 'totalActivityCnt', coalesce(sum(q_acc.'oppsum.Amount'), 0) as 'totalWonAmount', coalesce(sum(q_acc.'oppsum.WonCnt'), 0) as 'totalWonOppCnt';
q_acc_act_opp = filter q_acc_act_opp by 'totalActivityCnt' {{coalesce(cell(ActivityCntMeasureGroup.selection, 0, "value"), "> -1").asString()}};
q_out = group q_acc_act_opp by all;
q_out = foreach q_out generate sum('unique_Id') as 'unique_Id', sum('totalActivityCnt') as 'totalActivityCnt', sum('totalWonAmount') as 'totalWonAmount', sum('totalWonOppCnt') as 'totalWonOppCnt';
q_out = order q_out by ('unique_Id' desc);

ActivityMainGraph.query:
q = load "${App.Datasets.SFDC_EA_SP_Activity.FullyQualifiedName}";
q = filter q by 'IsClosed' == "true";
q = group q by ('ActivityDate_Year', 'ActivityDate_Month');
q = foreach q generate 'ActivityDate_Year' + "~~~" + 'ActivityDate_Month' as 'ActivityDate_Year~~~ActivityDate_Month', unique('Id') as 'unique_Id';
q = order q by 'ActivityDate_Year~~~ActivityDate_Month' asc;
q = limit q 2000;

